
-- create db and tables
create database hospital;
use hospital;

drop table bed_fact;
create table bed_fact(
fact_id int not null auto_increment,
ims_org_id varchar(20),
bed_id int,
license_beds int,
census_beds int,
staffed_beds int,
primary key(fact_id));

create table bed_type(
bed_id int not null,
bed_code varchar(30),
bed_desc varchar(100),
primary key(bed_id)
);

create table business(
ims_org_id varchar(20) not null,
business_name varchar(500),
ttl_license_beds int,
ttl_census_beds int,
ttl_staffed_beds int,
bed_cluster_id int,
primary key(ims_org_id)
);

