-- 4.a
select distinct business_name as `Hospital Name` from business a
join bed_fact b on a.ims_org_id = b.ims_org_id 
where b.bed_id = 4 or b.bed_id = 15;

select count(distinct ims_org_id) from bed_fact where bed_id = 4 or bed_id = 15;

-- licensed beds
select distinct b.business_name as `Hospital Name`, sum(a.license_beds) as `total licensed beds` from bed_fact a
join business b on a.ims_org_id = b.ims_org_id where a.bed_id in (4,15)
group by `Hospital Name`
order by `total licensed beds` desc
limit 10;

-- census beds
select distinct b.business_name as `Hospital Name`, sum(a.census_beds) as `total census beds` from bed_fact a
join business b on a.ims_org_id = b.ims_org_id where a.bed_id in (4,15)
group by `Hospital Name`
order by `total census beds` desc
limit 10;

-- staffed beds
select distinct b.business_name as `Hospital Name`, sum(a.staffed_beds) as `total staffed beds` from bed_fact a
join business b on a.ims_org_id = b.ims_org_id where a.bed_id in (4,15)
group by `Hospital Name`
order by `total staffed beds` desc
limit 10;

-- both ICU and SICU units
-- census beds
select distinct b.business_name as `Hospital Name` , sum(a.census_beds) as `total census beds` from bed_fact a
join business b on a.ims_org_id = b.ims_org_id
WHERE bed_id IN (4, 15)
GROUP BY `Hospital Name`
HAVING COUNT(DISTINCT bed_id) = 2
ORDER BY `total census beds` DESC
LIMIT 10;

-- license beds
select distinct b.business_name as `Hospital Name` , sum(a.license_beds) as `total licensed beds` from bed_fact a
join business b on a.ims_org_id = b.ims_org_id
WHERE bed_id IN (4, 15)
GROUP BY `Hospital Name`
HAVING COUNT(DISTINCT bed_id) = 2
ORDER BY `total licensed beds` DESC
LIMIT 10;

-- staffed beds
select distinct b.business_name as `Hospital Name` , sum(a.staffed_beds) as `total staffed beds` from bed_fact a
join business b on a.ims_org_id = b.ims_org_id
WHERE bed_id IN (4, 15)
GROUP BY `Hospital Name`
HAVING COUNT(DISTINCT bed_id) = 2
ORDER BY `total staffed beds` DESC
LIMIT 10;





